import React from 'react';
import CardList from '../../components/CardList/CardList';

const StorePage = (props) => {

    const { closeModal, addToCart, addToFavorite, setModalProps, setIsModalActive, data } = props



    return (

        <CardList closeModal={closeModal} addToCart={addToCart} addToFavorite={addToFavorite} setModalProps={setModalProps} setIsModalActive={setIsModalActive} data={data} />
    );
}

export default StorePage;
